import React from 'react';

const Header = () => {
    return (
        <header className="bg-gray-800 text-white p-4">
            <div className="container mx-auto flex justify-between items-center">
                <div className="text-lg font-bold">
                    This N That Mix Up Shop
                </div>
                <nav>
                    <ul className="flex space-x-4">
                        <li><a href="/" className="hover:text-gray-400">Home</a></li>
                        <li><a href="/apparel" className="hover:text-gray-400">Apparel</a></li>
                        <li><a href="/accessories" className="hover:text-gray-400">Accessories</a></li>
                        <li><a href="/figures" className="hover:text-gray-400">Figures</a></li>
                        <li><a href="/about-us" className="hover:text-gray-400">About Us</a></li>
                        <li><a href="/cart" className="hover:text-gray-400">Cart</a></li>
                        <li><a href="/checkout" className="hover:text-gray-400">Checkout</a></li>
                        <li><a href="/collections" className="hover:text-gray-400">Collections</a></li>
                    </ul>
                </nav>
            </div>
        </header>
    );
};

export default Header;
